import React from 'react'

const CollectionDetails = ({items}) => {

    const {name, imageUrl} = items;
    return (
        <div>
            {
                items.map(item => (
                <>
                    <h1>{name}</h1>
                    <img src={imageUrl} alt=""/>
                </>
                ))
            }
        </div>
    )
}

export default CollectionDetails
